import { AppBar, Toolbar, Typography, Button, Box } from "@mui/material";
import { NavLink } from "react-router-dom";
import { motion } from "framer-motion";

export default function Navbar() {
  return (
    <motion.div initial={{ y: -80 }} animate={{ y: 0 }} transition={{ duration: 0.6 }}>
      <AppBar position="sticky">
        <Toolbar>
          {/* Logo */}
          <Typography variant="h6" sx={{ flexGrow: 1, fontWeight: "bold" }}>
            PhysioTattva
          </Typography>

          {/* Nav Buttons */}
          <Box sx={{ display: "flex", gap: 2 }}>
            <Button component={NavLink} to="/" sx={navBtnStyle}>
              Home
            </Button>

            <Button component={NavLink} to="/services" sx={navBtnStyle}>
              Services
            </Button>

            <Button component={NavLink} to="/about" sx={navBtnStyle}>
              About
            </Button>

            <Button component={NavLink} to="/contact" sx={navBtnStyle}>
              Contact
            </Button>

            {/* Special Button */}
            <Button
              variant="contained"
              color="secondary"
              sx={{ borderRadius: "20px", px: 3 }}
            >
              Book Appointment
            </Button>
          </Box>
        </Toolbar>
      </AppBar>
    </motion.div>
  );
}

const navBtnStyle = {
  color: "white",
  textTransform: "none",
  fontSize: "16px",
  "&:hover": {
    backgroundColor: "rgba(255,255,255,0.2)",
  },
  "&.active": {
    borderBottom: "2px solid yellow",
  },
};
